HOW TO: my current everyday 5-minute hair routine for these beachy 🌊 and piecy waves… with a little claw clip half up hairstyle to finish off the look ❤️‍🔥😮‍💨

@bumbleandbumble heat shield
@oribe dry texturizing spray
@igkhair volume powder spray
@daehair prickly pear hair oil to rehydrate my ends
@hottoolspro 3/4th curling iron
clips are from amazon 🤎
